import React from "react";
import {Link} from "react-router-dom";
import './style/styie.css';
import { AiFillCaretRight } from "react-icons/ai";
import { AiFillSmile } from "react-icons/ai";
function Sidebar(){
    return (
        <div className="left-column">

            <AiFillCaretRight/>Dashboard

            <Link to="/"><AiFillSmile/>Dashboard </Link>
            <Link to="/setting"><AiFillSmile/>Setting </Link>
            <Link to="/visualization"><AiFillSmile/>visualization </Link>
            <Link to="/note">note </Link>
            <Link to="/aboutME">aboutME </Link>
                <div className="Dsb">
                    <div className="Default">
                        <AiFillSmile/>Default
                    </div>
                    <div className="eCommerce">
                        <AiFillSmile/>eCommerce
                    </div>
                    <div className="Projects">
                        <AiFillSmile/>Projects
                    </div>
                    <div className="OnlineCourses">
                        <AiFillSmile/>OnlineCourses
                    </div>
                </div>

            </div>
            /*
        <div>

        </div>*/
    );
}

export default Sidebar;
